import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, colors } from '../../utilities';
import {SliderContainer} from '../Container';

const Fut = ({className}) => {
  return (
    <SliderContainer className={className}>    
      <h3>Futbolitos</h3>
      <p>Infantil y adultos</p>    
    </SliderContainer>
  );
}

const SlideFut = styled(Fut)`
  background-image: linear-gradient(to right, ${colors.green_2}, ${colors.purple_2});

`;

export default SlideFut;
